PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_department" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(32) NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_prettynum" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "mobile" varchar(11) NOT NULL, "price" integer NOT NULL, "level" smallint NOT NULL, "status" smallint NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_admin" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "username" varchar(32) NOT NULL, "password" varchar(64) NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_task" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "level" smallint NOT NULL, "title" varchar(64) NOT NULL, "detail" text NOT NULL, "user_id" bigint NOT NULL REFERENCES "app01_admin" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app01_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "oid" varchar(64) NOT NULL, "title" varchar(32) NOT NULL, "price" integer NOT NULL, "status" smallint NOT NULL, "admin_id" bigint NOT NULL REFERENCES "app01_admin" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app01_boss" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(32) NOT NULL, "age" integer NOT NULL, "img" varchar(128) NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_xx" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(32) NOT NULL, "image" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_baseinfoproduct" ("品类iD" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "品类名称" varchar(255) NOT NULL, "品种名称" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_baseinfoworktype" ("分类名称" varchar(255) NOT NULL, "工种ID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "分类级别" integer NOT NULL, "父分类" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "app01_baseinfobase" ("ID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "基地ID" integer NULL, "基地" varchar(255) NOT NULL, "基地经理" varchar(255) NOT NULL, "面积" real NULL, "代号" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_agriculture_cost" ("ID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "日期" date NULL, "数量" real NULL, "农资种类" varchar(255) NULL, "名称" varchar(255) NULL, "单价" decimal NULL, "批次" varchar(255) NULL, "地块" varchar(255) NULL, "金额" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_costagriculture" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "批次" varchar(255) NULL, "地块" decimal NULL, "单据编号" decimal NULL, "商品全名" decimal NULL, "规格" decimal NULL, "数量" decimal NULL, "单位" decimal NULL, "单价" decimal NULL, "备注" varchar(255) NULL, "金额" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_costallocation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "月度" varchar(255) NULL, "散装工时" decimal NULL, "农家肥" decimal NULL, "材料" decimal NULL, "生活费" decimal NULL, "水电费" decimal NULL, "地租" decimal NULL, "大棚管架" decimal NULL, "大棚棚膜" decimal NULL, "大棚喷灌" decimal NULL, "其他资产" decimal NULL, "有机肥" decimal NULL, "出勤奖" decimal NULL, "服务费" decimal NULL, "基地经理" decimal NULL, "批次" varchar(255) NULL, "管理费" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_costlandpreparation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "月份" varchar(255) NULL, "地块" varchar(10) NULL, "批次" varchar(255) NULL, "实际打药面积" decimal NULL, "数量" decimal NULL, "单位" decimal NULL, "单价" decimal NULL, "金额" decimal NULL, "备注" varchar(255) NULL, "打地人姓名" varchar(255) NULL, "申请打地时间" date NULL, "预计打地时间" date NULL, "实际打地时间" date NULL, "工种" varchar(255) NULL, "面积" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_costpesticide" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "批次" varchar(255) NULL, "地块" decimal NULL, "实际打药面积" decimal NULL, "数量" decimal NULL, "单位" decimal NULL, "单价" decimal NULL, "金额" decimal NULL, "次数" integer NULL, "服务人员" varchar(255) NULL, "申请打药时间" date NULL, "预计打药时间" date NULL, "实际打药时间" date NULL, "面积" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_costtotal" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "批次" varchar(255) NULL, "人工费用" decimal NULL, "农资费用" decimal NULL, "打药费用" decimal NULL, "打地费用" decimal NULL, "折旧费用" decimal NULL, "出库" decimal NULL, "销售" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_plandaily" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "上批批次" varchar(255) NULL, "地块" varchar(255) NULL, "种植日期" date NULL, "采收" varchar(255) NULL, "打地" varchar(255) NULL, "SC" varchar(255) NULL, "FF" varchar(255) NULL, "下一批种植日期" date NULL, "种植品种" varchar(255) NULL, "未K" varchar(255) NULL, "备注" varchar(255) NULL, "种植规格" varchar(255) NULL, "面积" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_plansummary" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "移栽时间" date NULL, "批次ID" varchar(255) NULL, "计划种植" decimal NULL, "实际种植" decimal NULL, "计划达成率" decimal NULL, "生长周期" decimal NULL, "踩栽周期" date NULL, "踩栽末期" date NULL, "下一批前一天" date NULL, "损耗" decimal NULL, "实际采收" decimal NULL, "计划实际采收率" decimal NULL, "实际销售" decimal NULL, "计划销售率" decimal NULL, "预估客销售" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_productionbatch" ("iD" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "批次ID" varchar(255) NOT NULL UNIQUE, "销毁面积" decimal NULL, "地块" varchar(255) NULL, "批次" integer NULL, "生长周期" decimal NULL, "采收初期" date NULL, "采收末期" date NULL, "采收周期" date NULL, "总周期" decimal NULL, "实际总产量" decimal NULL, "正常总产量" decimal NULL, "总亩产量" decimal NULL, "正常亩产量" decimal NULL, "产品iD_id" integer NULL REFERENCES "app01_baseinfoproduct" ("品类iD") DEFERRABLE INITIALLY DEFERRED, "基地ID_id" integer NULL REFERENCES "app01_baseinfobase" ("ID") DEFERRABLE INITIALLY DEFERRED, "面积" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_productionwage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "日期" date NULL, "工时" decimal NULL, "合计工资" decimal NULL, "批次" varchar(255) NULL, "地块" varchar(255) NULL, "一级分类" varchar(255) NULL, "二级分类" varchar(255) NULL, "一级工种" varchar(255) NULL, "工人" varchar(255) NULL, "工价" decimal NULL, "基地" varchar(255) NULL, "数量" decimal NULL, "负责人" varchar(255) NULL, "累计工时" decimal NULL, "备注" varchar(255) NULL, "二级工种" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "app01_salesdetail" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "日期" date NULL, "车次" varchar(255) NULL, "销售地区" varchar(255) NULL, "品类" varchar(255) NULL, "规格" varchar(255) NULL, "框数" integer NULL, "单价" decimal NULL, "重量" decimal NULL, "批次" varchar(255) NULL, "地块" varchar(255) NULL, "是否正常产量" varchar(255) NULL, "销售额" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_salesoutbound" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "日期" date NULL, "车牌" varchar(255) NULL, "公司" varchar(255) NULL, "市场" varchar(255) NULL, "品类" varchar(255) NULL, "规格" varchar(255) NULL, "数量" decimal NULL, "单位" decimal NULL, "地块" varchar(255) NULL, "批次" varchar(255) NULL, "盖布" varchar(255) NULL, "备注" varchar(255) NULL, "挑菜" varchar(255) NULL, "客户" varchar(255) NULL, "重量" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_salessummary" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "出库日期" date NULL, "收款日期" date NULL, "公司" varchar(255) NULL, "市场" varchar(255) NULL, "车牌" varchar(255) NULL, "销售人员" varchar(255) NULL, "客户" varchar(255) NULL, "类别" varchar(255) NULL, "品种" varchar(255) NULL, "应销框数" integer NULL, "实际框数" integer NULL, "单位" decimal NULL, "数量" decimal NULL, "地块" varchar(255) NULL, "批次" varchar(255) NULL, "单价" decimal NULL, "应收金额" decimal NULL, "实收金额" decimal NULL, "应收金额合计" decimal NULL, "实收金额合计" decimal NULL, "差额" decimal NULL, "合计框数" decimal NULL, "上车拨入框数" decimal NULL, "本车拨入框数" decimal NULL, "备注" varchar(255) NULL, "收款方式" varchar(255) NULL, "规格" decimal NULL);
CREATE TABLE IF NOT EXISTS "工资花名册" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "公司" varchar(100) NOT NULL, "归属业主" varchar(100) NOT NULL, "姓名" varchar(100) NOT NULL, "清棚" decimal NOT NULL, "点籽" decimal NOT NULL, "移栽" decimal NOT NULL, "锄草" decimal NOT NULL, "间菜" decimal NOT NULL, "拔草" decimal NOT NULL, "打药" decimal NOT NULL, "施肥" decimal NOT NULL, "吹生菜" decimal NOT NULL, "插竹竿绑线" decimal NOT NULL, "收菜" decimal NOT NULL, "清废菜" decimal NOT NULL, "绑线" decimal NOT NULL, "散工" decimal NOT NULL, "修枝" decimal NOT NULL, "绑枝" decimal NOT NULL, "插竹竿" decimal NOT NULL, "其它" decimal NOT NULL, "铲沟草" decimal NOT NULL, "锄拔草" decimal NOT NULL, "合计工时" decimal NOT NULL, "合计工资" decimal NOT NULL, "平均工资" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_planplantbatch" ("ID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "批次ID" varchar(10) NULL, "移栽日期" date NULL, "品种" varchar(255) NULL, "品类" varchar(255) NULL, "面积" decimal NULL, "基地ID" varchar(11) NULL, "移栽数量" decimal NULL, "移栽板量" decimal NULL, "点子数量" decimal NULL, "地块" varchar(255) NULL, "备注" varchar(255) NULL, "生长周期" decimal NULL, "采收期" varchar(255) NULL, "采收初期" date NULL, "周期批次" varchar(255) NULL, "总周期天数" decimal NULL, "销毁面积" decimal NULL, "销毁备注" decimal NULL, "栽种方式" varchar(255) NULL, "正常产量" decimal NULL, "正常亩产" decimal NULL, "总产量" decimal NULL, "总亩产" decimal NULL, "下批前一天时间" date NULL, "周期" varchar(255) NULL, "采收末期" date NULL);
CREATE TABLE IF NOT EXISTS "app01_lossreport" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "报损时间" datetime NOT NULL, "报损人" varchar(255) NOT NULL, "批次" varchar(255) NOT NULL, "报损地块" varchar(255) NOT NULL, "报损类型" varchar(50) NOT NULL, "报损数量" decimal NOT NULL, "报损单位" varchar(50) NOT NULL, "备注" text NULL, "报损面积" decimal NULL);
CREATE TABLE IF NOT EXISTS "app01_salesperson" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "姓名" varchar(255) NOT NULL, "所属公司" varchar(255) NOT NULL, "电话" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_vehicle" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "车牌" varchar(50) NOT NULL UNIQUE, "司机" varchar(255) NOT NULL, "电话" varchar(20) NOT NULL, "型号" varchar(255) NOT NULL, "颜色" varchar(255) NOT NULL, "类型" varchar(255) NOT NULL, "备注" text NULL, "身份证号码" varchar(18) NULL, "市场分类_id" bigint NULL REFERENCES "app01_market" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app01_market" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "市场名称" varchar(255) NOT NULL UNIQUE, "地区" varchar(255) NOT NULL, "地址" varchar(255) NOT NULL, "联系人" varchar(255) NOT NULL, "插入时间" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_expenseallocation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "生活费" decimal NOT NULL, "水电费" decimal NOT NULL, "服务费" decimal NOT NULL, "其他费用" decimal NOT NULL, "其他资产" decimal NOT NULL, "农家肥" decimal NOT NULL, "出勤奖" decimal NOT NULL, "地租" decimal NOT NULL, "地租大棚摊销" decimal NOT NULL, "报销费用" decimal NOT NULL, "散工工时" decimal NOT NULL, "有机肥" decimal NOT NULL, "材料费" decimal NOT NULL, "浇水打杂费用" decimal NOT NULL, "管理费1" decimal NOT NULL, "草莓土" decimal NOT NULL, "批次" varchar(100) NOT NULL, "燃油费" decimal NOT NULL, "维修费" decimal NOT NULL, "销售费" decimal NOT NULL, "基地经理" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_userinfo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(16) NOT NULL, "password" varchar(64) NOT NULL, "age" integer NOT NULL, "create_time" date NULL, "depart_id" bigint NULL REFERENCES "app01_department" ("id") DEFERRABLE INITIALLY DEFERRED, "bank_account" varchar(64) NULL, "phone" varchar(20) NULL, "salary" decimal NULL, "gender" smallint NULL, "id_card" varchar(18) NULL, "bank_name" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "app01_jobcategoryinfo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category_name" varchar(50) NOT NULL, "category_level" integer NOT NULL, "parent_category_id" bigint NULL REFERENCES "app01_jobcategoryinfo" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app01_jobtypedetailinfo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "job_name" varchar(50) NOT NULL, "job_level" integer NOT NULL, "parent_job_id" bigint NULL REFERENCES "app01_jobtypedetailinfo" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app01_plant_batch" ("ID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "批次ID" varchar(50) NULL UNIQUE, "地块" varchar(255) NULL, "面积" decimal NULL, "基地经理" varchar(255) NULL, "移栽板量" real NULL, "移栽数量" real NULL, "点籽日期" date NULL, "用籽量" real NULL, "备注" varchar(255) NULL, "一级分类" varchar(255) NULL, "二级分类" varchar(255) NULL, "update_date" date NULL, "uploader" varchar(255) NULL, "下批前一天时间" date NULL, "周期" varchar(255) NULL, "周期批次" varchar(255) NULL, "总产量" decimal NULL, "总亩产" decimal NULL, "总周期天数" decimal NULL, "栽种方式" varchar(255) NULL, "正常产量" decimal NULL, "正常亩产" decimal NULL, "生长周期" decimal NULL, "采收初期" date NULL, "采收期" varchar(255) NULL, "采收末期" date NULL, "销毁备注" varchar(255) NULL, "销毁面积" decimal NULL, "基地" varchar(255) NULL, "种植日期" date NULL, "吹生菜周期" decimal NULL, "吹生菜开始时间" date NULL, "吹生菜数量" real NULL, "吹生菜结束时间" date NULL, "打地周期" decimal NULL, "打地开始时间" date NULL, "打地数量" real NULL, "打地结束时间" date NULL, "施肥周期" decimal NULL, "施肥开始时间" date NULL, "施肥数量" real NULL, "施肥结束时间" date NULL, "清棚周期" decimal NULL, "清棚开始时间" date NULL, "清棚数量" real NULL, "清棚结束时间" date NULL, "点籽周期" decimal NULL, "点籽开始时间" date NULL, "点籽数量" real NULL, "点籽结束时间" date NULL, "移栽周期" decimal NULL, "移栽开始时间" date NULL, "移栽结束时间" date NULL, "采收周期" decimal NULL, "采收开始时间" date NULL, "采收数量" real NULL, "采收结束时间" date NULL, "间菜周期" decimal NULL, "间菜开始时间" date NULL, "间菜数量" real NULL, "间菜结束时间" date NULL, "除草周期" decimal NULL, "除草开始时间" date NULL, "除草数量" real NULL, "除草结束时间" date NULL);
CREATE TABLE IF NOT EXISTS "app01_costalertfeedback" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "批次ID" varchar(50) NOT NULL, "工种" varchar(255) NULL, "反馈内容" text NULL, "反馈时间" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_processalert" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "一级分类" varchar(100) NOT NULL, "二级分类" varchar(100) NOT NULL, "一级工种" varchar(100) NOT NULL, "二级工种" varchar(100) NOT NULL, "最小时间" integer unsigned NOT NULL CHECK ("最小时间" >= 0), "最大时间" integer unsigned NOT NULL CHECK ("最大时间" >= 0));
CREATE TABLE IF NOT EXISTS "app01_monthlyplan" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "日期" date NOT NULL, "面积" decimal NOT NULL, "周期" integer NOT NULL, "二级分类_id" bigint NOT NULL REFERENCES "app01_jobcategoryinfo" ("id") DEFERRABLE INITIALLY DEFERRED, "未达成反馈" text NULL, "五天种植单位亩" decimal NOT NULL, "备注" text NULL, "每天产量单位吨" decimal NOT NULL, "每天数量单位框" integer NOT NULL, "每天种植单位亩" decimal NOT NULL, "盘数" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_dailyplan" ("批次ID" varchar(100) NOT NULL PRIMARY KEY, "地块" varchar(255) NOT NULL, "面积" decimal NOT NULL, "种植日期" date NOT NULL, "备注" text NULL, "上批批次" varchar(100) NULL, "下批种植日期" date NULL, "业主" varchar(255) NOT NULL, "播种方式" varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_depreciationallocation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "地租" decimal NOT NULL, "大棚管架" decimal NOT NULL, "大棚棚膜" decimal NOT NULL, "大棚喷灌" decimal NOT NULL, "其他资产" decimal NOT NULL, "材料" decimal NOT NULL, "基地经理_id" integer NOT NULL REFERENCES "app01_baseinfobase" ("ID") DEFERRABLE INITIALLY DEFERRED, "月份" date NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_baseinfoworkhour" ("工种ID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "单价" decimal NULL, "单位" varchar(255) NULL, "备注" varchar(50) NULL, "一级分类_id" bigint NULL REFERENCES "app01_jobcategoryinfo" ("id") DEFERRABLE INITIALLY DEFERRED, "二级分类_id" bigint NULL REFERENCES "app01_jobcategoryinfo" ("id") DEFERRABLE INITIALLY DEFERRED, "默认计入成本" varchar(2) NOT NULL, "一级工种_id" bigint NULL REFERENCES "app01_jobtypedetailinfo" ("id") DEFERRABLE INITIALLY DEFERRED, "二级工种_id" bigint NULL REFERENCES "app01_jobtypedetailinfo" ("id") DEFERRABLE INITIALLY DEFERRED, "上传人" varchar(50) NULL, "上传时间" datetime NULL, "最后更新时间" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_uploader" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "update_date" date NOT NULL, "update_user" varchar(100) NOT NULL, "excel_file" varchar(128) NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_customer" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "客户名称" varchar(255) NOT NULL, "联系人" varchar(255) NOT NULL, "联系电话" varchar(20) NOT NULL, "邮箱" varchar(254) NULL, "地址" varchar(255) NULL, "销售地区" varchar(255) NULL, "客户类型" varchar(50) NOT NULL, "公司名称" varchar(255) NULL, "公司网站" varchar(200) NULL, "公司地址" varchar(255) NULL, "行业" varchar(255) NULL, "备注" text NULL, "更新时间" datetime NULL, "主要销售品种" varchar(255) NULL, "主要销售地区" varchar(255) NULL, "客户流失原因" text NULL, "客户流失时间" text NULL, "市场分类_id" bigint NULL REFERENCES "app01_market" ("id") DEFERRABLE INITIALLY DEFERRED, "是否新客户" varchar(10) NOT NULL, "创建时间" datetime NULL);
CREATE TABLE IF NOT EXISTS "app01_channel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "渠道名称" varchar(255) NOT NULL UNIQUE, "地区" varchar(255) NOT NULL, "联系人" varchar(255) NOT NULL, "插入时间" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_dailypricereport" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "日期" date NOT NULL, "价格" decimal NOT NULL, "品种_id" bigint NOT NULL REFERENCES "app01_jobcategoryinfo" ("id") DEFERRABLE INITIALLY DEFERRED, "价格上限" decimal NULL, "市场_id" bigint NOT NULL REFERENCES "app01_channel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app01_outboundrecord" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "日期" date NULL, "公司" varchar(255) NOT NULL, "规格" varchar(255) NOT NULL, "单位" varchar(255) NOT NULL, "批次" varchar(255) NOT NULL, "地块" varchar(255) NOT NULL, "备注" text NULL, "市场" varchar(255) NOT NULL, "车牌" varchar(255) NOT NULL, "品种" varchar(255) NOT NULL, "品类" varchar(255) NOT NULL, "盖布_块" varchar(255) NOT NULL, "重量_kg" decimal NOT NULL, "数量_筐" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "app01_salesrecord" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "客户" varchar(255) NOT NULL, "数量" decimal NOT NULL, "单价" decimal NOT NULL, "金额" decimal NOT NULL, "应收金额" decimal NOT NULL, "实收金额" decimal NOT NULL, "备注" text NULL, "出库记录_id" bigint NOT NULL REFERENCES "app01_outboundrecord" ("id") DEFERRABLE INITIALLY DEFERRED, "批次" varchar(255) NOT NULL, "销售日期" date NULL, "单位" varchar(255) NULL, "收款方式" varchar(255) NULL, "收款日期" date NULL, "规格" varchar(255) NULL, "销售人员" varchar(255) NULL, "实销筐数" decimal NOT NULL);
