CREATE VIEW views_工资花名册 as
SELECT 
    ROW_NUMBER() OVER (ORDER BY 日期)  id ,
    基地 公司,
    负责人 归属业主,
    工人 姓名,
    SUBSTR(日期, 1, 4) || SUBSTR(日期, 6, 2) 日期,
    SUM(CASE WHEN 一级分类 = '清棚' THEN 合计工资 ELSE 0 END) AS 清棚,
    SUM(CASE WHEN 一级分类 = '点籽' THEN 合计工资 ELSE 0 END) AS 点籽,
    SUM(CASE WHEN 一级分类 = '移栽' THEN 合计工资 ELSE 0 END) AS 移栽,
    SUM(CASE WHEN 一级分类 = '锄草' THEN 合计工资 ELSE 0 END) AS 锄草,
    SUM(CASE WHEN 一级分类 = '间菜' THEN 合计工资 ELSE 0 END) AS 间菜,
    SUM(CASE WHEN 一级分类 = '拔草' THEN 合计工资 ELSE 0 END) AS 拔草,
    SUM(CASE WHEN 一级分类 = '打药' THEN 合计工资 ELSE 0 END) AS 打药,
    SUM(CASE WHEN 一级分类 = '施肥' THEN 合计工资 ELSE 0 END) AS 施肥,
    SUM(CASE WHEN 一级分类 = '吹生菜' THEN 合计工资 ELSE 0 END) AS 吹生菜,
    SUM(CASE WHEN 一级分类 = '插竹竿绑线' THEN 合计工资 ELSE 0 END) AS 插竹竿绑线,
    SUM(CASE WHEN 一级分类 = '收菜' THEN 合计工资 ELSE 0 END) AS 收菜,
    SUM(CASE WHEN 一级分类 = '清废菜' THEN 合计工资 ELSE 0 END) AS 清废菜,
    SUM(CASE WHEN 一级分类 = '绑线' THEN 合计工资 ELSE 0 END) AS 绑线,
    SUM(CASE WHEN 一级分类 = '散工' THEN 合计工资 ELSE 0 END) AS 散工,
    SUM(CASE WHEN 一级分类 = '修枝' THEN 合计工资 ELSE 0 END) AS 修枝,
    SUM(CASE WHEN 一级分类 = '绑枝' THEN 合计工资 ELSE 0 END) AS 绑枝,
    SUM(CASE WHEN 一级分类 = '插竹竿' THEN 合计工资 ELSE 0 END) AS 插竹竿,
    SUM(CASE WHEN 一级分类 = '其它' THEN 合计工资 ELSE 0 END) AS 其它,
    SUM(CASE WHEN 一级分类 = '铲沟草' THEN 合计工资 ELSE 0 END) AS 铲沟草,
    SUM(CASE WHEN 一级分类 = '锄拔草' THEN 合计工资 ELSE 0 END) AS 锄拔草,
    SUM(工时) AS 合计工时,
    SUM(合计工资) AS 合计工资,
    avg(合计工资) AS 平均工资
FROM app01_productionwage  -- 替换为你的实际表名


GROUP BY  基地,
    负责人,
    工人,SUBSTR(日期, 1, 4) || SUBSTR(日期, 6, 2)
order  by 日期
;
CREATE VIEW views_每日工资表 as
WITH WageData AS (
    SELECT 
        工人,
        基地,
        负责人,
        SUBSTR(日期, 1, 4) || SUBSTR(日期, 6, 2) AS 月份,
        CAST(SUBSTR(日期, 9, 2) AS INTEGER) AS 日,
        合计工资
    FROM app01_productionwage
),
AggregatedData AS (
    SELECT 
        工人,
        基地,
        负责人,
        月份,
        日,
        SUM(合计工资) AS 合计工资
    FROM WageData
    GROUP BY 工人, 基地, 负责人, 月份, 日
),
FinalData AS (
    SELECT 
        工人,
        基地,
        负责人,
        月份,
        ROUND(SUM(CASE WHEN 日 = 1 THEN 合计工资 ELSE 0 END), 2) AS Day_1,
        ROUND(SUM(CASE WHEN 日 = 2 THEN 合计工资 ELSE 0 END), 2) AS Day_2,
        ROUND(SUM(CASE WHEN 日 = 3 THEN 合计工资 ELSE 0 END), 2) AS Day_3,
        ROUND(SUM(CASE WHEN 日 = 4 THEN 合计工资 ELSE 0 END), 2) AS Day_4,
        ROUND(SUM(CASE WHEN 日 = 5 THEN 合计工资 ELSE 0 END), 2) AS Day_5,
        ROUND(SUM(CASE WHEN 日 = 6 THEN 合计工资 ELSE 0 END), 2) AS Day_6,
        ROUND(SUM(CASE WHEN 日 = 7 THEN 合计工资 ELSE 0 END), 2) AS Day_7,
        ROUND(SUM(CASE WHEN 日 = 8 THEN 合计工资 ELSE 0 END), 2) AS Day_8,
        ROUND(SUM(CASE WHEN 日 = 9 THEN 合计工资 ELSE 0 END), 2) AS Day_9,
        ROUND(SUM(CASE WHEN 日 = 10 THEN 合计工资 ELSE 0 END), 2) AS Day_10,
        ROUND(SUM(CASE WHEN 日 = 11 THEN 合计工资 ELSE 0 END), 2) AS Day_11,
        ROUND(SUM(CASE WHEN 日 = 12 THEN 合计工资 ELSE 0 END), 2) AS Day_12,
        ROUND(SUM(CASE WHEN 日 = 13 THEN 合计工资 ELSE 0 END), 2) AS Day_13,
        ROUND(SUM(CASE WHEN 日 = 14 THEN 合计工资 ELSE 0 END), 2) AS Day_14,
        ROUND(SUM(CASE WHEN 日 = 15 THEN 合计工资 ELSE 0 END), 2) AS Day_15,
        ROUND(SUM(CASE WHEN 日 = 16 THEN 合计工资 ELSE 0 END), 2) AS Day_16,
        ROUND(SUM(CASE WHEN 日 = 17 THEN 合计工资 ELSE 0 END), 2) AS Day_17,
        ROUND(SUM(CASE WHEN 日 = 18 THEN 合计工资 ELSE 0 END), 2) AS Day_18,
        ROUND(SUM(CASE WHEN 日 = 19 THEN 合计工资 ELSE 0 END), 2) AS Day_19,
        ROUND(SUM(CASE WHEN 日 = 20 THEN 合计工资 ELSE 0 END), 2) AS Day_20,
        ROUND(SUM(CASE WHEN 日 = 21 THEN 合计工资 ELSE 0 END), 2) AS Day_21,
        ROUND(SUM(CASE WHEN 日 = 22 THEN 合计工资 ELSE 0 END), 2) AS Day_22,
        ROUND(SUM(CASE WHEN 日 = 23 THEN 合计工资 ELSE 0 END), 2) AS Day_23,
        ROUND(SUM(CASE WHEN 日 = 24 THEN 合计工资 ELSE 0 END), 2) AS Day_24,
        ROUND(SUM(CASE WHEN 日 = 25 THEN 合计工资 ELSE 0 END), 2) AS Day_25,
        ROUND(SUM(CASE WHEN 日 = 26 THEN 合计工资 ELSE 0 END), 2) AS Day_26,
        ROUND(SUM(CASE WHEN 日 = 27 THEN 合计工资 ELSE 0 END), 2) AS Day_27,
        ROUND(SUM(CASE WHEN 日 = 28 THEN 合计工资 ELSE 0 END), 2) AS Day_28,
        ROUND(SUM(CASE WHEN 日 = 29 THEN 合计工资 ELSE 0 END), 2) AS Day_29,
        ROUND(SUM(CASE WHEN 日 = 30 THEN 合计工资 ELSE 0 END), 2) AS Day_30,
        ROUND(SUM(CASE WHEN 日 = 31 THEN 合计工资 ELSE 0 END), 2) AS Day_31,
        ROUND(SUM(合计工资), 2) AS 合计
    FROM AggregatedData
    GROUP BY 工人, 基地, 负责人, 月份
)
SELECT
    ROW_NUMBER() OVER (ORDER BY 工人, 月份) AS ID,
    工人,
    基地,
    负责人,
    月份,
    Day_1,
    Day_2,
    Day_3,
    Day_4,
    Day_5,
    Day_6,
    Day_7,
    Day_8,
    Day_9,
    Day_10,
    Day_11,
    Day_12,
    Day_13,
    Day_14,
    Day_15,
    Day_16,
    Day_17,
    Day_18,
    Day_19,
    Day_20,
    Day_21,
    Day_22,
    Day_23,
    Day_24,
    Day_25,
    Day_26,
    Day_27,
    Day_28,
    Day_29,
    Day_30,
    Day_31,
    合计
FROM FinalData
ORDER BY 工人, 月份;
