CREATE VIEW view_DailyPriceReport as
SELECT
    r.日期 AS ReportDate,
    c.category_name AS JobCategory,  -- 二级分类（品种）
    MAX(CASE WHEN m.市场名称 = '祥城' THEN r.价格 ELSE 0 END) AS XiangChengPrice,
    MAX(CASE WHEN m.市场名称 = '零售' THEN r.价格 ELSE 0 END) AS LingShouPrice,
    MAX(CASE WHEN m.市场名称 = '昆明' THEN r.价格 ELSE 0 END) AS KunMingPrice,
    MAX(CASE WHEN m.市场名称 = '贵州' THEN r.价格 ELSE 0 END) AS GuiZhouPrice,
    MAX(CASE WHEN m.市场名称 = '红青冷库' THEN r.价格 ELSE 0 END) AS HongQingPrice,
    MAX(CASE WHEN m.市场名称 = '下关' THEN r.价格 ELSE 0 END) AS XiaGuanPrice
FROM
    app01_DailyPriceReport r
JOIN
    app01_Market m ON r.市场_id = m.ID  -- 连接市场表
JOIN
    app01_JobCategoryInfo c ON r.品种_id = c.ID  -- 连接品种（二级分类）表
GROUP BY
    r.日期, c.category_name
ORDER BY
    r.日期, c.category_name
;
